function Paragraph() {
  return (
    <p>
      As you can see, the prop Text is capitalized, which is a requirement in
      React. So in summary, capitalization in React is not just a best practice,
      but it is necessary for certain elements and props to be properly
      recognized and rendered.
    </p>
  );
}

export default Paragraph;
